import { Link } from "react-router-dom";

const RouteTest = () => {
  return (
    <>
      <link to={"/"}>HOME</link>
      <br />
      <link to={"/diary"}>DIARY</link>
      <br />
      <link to={"/new"}>NEW</link>
      <br />
      <link to={"/edit"}>EDIT</link>
    </>
  );
};
export default RouteTest;
